import React, { Fragment } from "react";
import { Helmet, HelmetProvider } from "react-helmet-async";

function Faq() {
    return (
        <Fragment>
    <HelmetProvider>
      <Helmet>
        <title> About Us | Zom - IN </title>
      </Helmet>
    </HelmetProvider>
    <div id="aboutUs" className="aboutUs my-2">
    </div>
    </Fragment>
    )
}

export default Faq
